import React from "react";
import Navigation from "../../components/Navigation";
import pdf from "../../cv_pdf/Cv_karim_ait-el-djoudi.pdf";
import { FaDownload } from "react-icons/fa";
import Navbar from "../../components/Navbar";

function Home_cv() {
  return (
    <div>
      <div className="home">
        <Navigation />
        <div className="homeContent">
          <div className="content">
            <h1>Karim AIT EL DJOUDI</h1>
            <h2>Dévelopeur Informatique</h2>
            <div className="pdf">
              <a href={pdf} download>
                <FaDownload /> Télécharger le Cv
              </a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home_cv;
